import React from 'react';
import { Link } from "react-router-dom";

function HeaderActions() {
    return (
        <div className="hidden sm:flex items-center gap-x-5 sm:gap-x-8">
            <Link 
                to="/quantfund"
                className="text-sm leading-6 font-semibold text-[oklch(44.889%_0.15545_-73.341)] no-underline"
            >
                The Fund
            </Link>
            <a href="https://discord.gg/your-discord-link" target="_blank" rel="noopener noreferrer">
                <button className="text-sm leading-6 font-semibold text-[oklch(44.889%_0.15545_-73.341)]">
                    Join Discord
                </button>
            </a>
        </div>
    );
}

export default HeaderActions;
